import './App.css';
import HeaderComponent from './components/HeaderComponent';
import ListTicketComponent from "./components/ListTickets";
import  {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import CreateTicketComponent from "./components/CreateTicketComponent"

function App() {
  return (
    <div>
      <Router>
        <HeaderComponent />
        <div className="container">
          <Switch> 
            <Route Path = "/" exact component = {ListTicketComponent}></Route>
            <Route Path = "/getAllTickets" exact component = {ListTicketComponent}></Route>
            <Route Path = "/addTicket" exact component = {CreateTicketComponent}></Route>
          </Switch>

        </div>
      </Router>
    </div>

  );
}

export default App;
